node.text:
A un giorno dalla partenza per un avventura che mi cambierà completamente mi sento FELICE grazie ad alcune persone; voglio ringraziare inanzitutto la mia famiglia che mi ha fatto crescere al meglio, mi ha sempre sostenuta in ciò che faccio e mi ha permesso di vivere un esperienza unica e indistinguibile, mio fratello @jacopo.noris che nonostante i litigi, abbiamo superato tutto insieme senza neanche accorgercene.
Inoltre non posso esprimere il bene che provo per tutti gli amici che standomi accanto mi hanno indubbiamente fatto passare momenti indescrivibili. 
@alicesciarra che conosco da una vita e che in questi dodici anni ci è sempre stata per ogni singola cosa, @aliceepenzoo che considero una sorella ormai e che mi conosce come nessun altro, con cui ho vissuto i momenti più belli della mia adolescenza (non scorderò mai l serata latin con i cubani e tutte le altre mille cazzate fatte insieme). @alessialazzarii , non riesco a descrivere il nostro rapporto d’intesa, superare gli ostacoli insieme e darci consigli su tutto.
@martinaalastilla la ginnastica ci ha legato ma anche se questo percorso si è interrotto noi non abbiamo smesso di passare le nostre fantastiche giornate insieme,
@_grezz @susaannamanzo @cristinamatarozzo a cui devo molto e con cui ho vissuto le migliori avventure tra i banchi di scuola. 
e infine tutte le persone con cui ho fatto una marea di cazzate e che mi fanno ridere ogni giorno sempre di più (anche se non vi taggo tutti valete davvero tanto per me). Non ho ripensamenti, sono sicura di voler passare questi dieci mesi dall’altra parte del mondo di superare gli ostacoli e le difficoltà che mi si porranno davanti e di vivere con serenità e frontezza questo percorso della mia vita.❤️
